	add("bulbul", "{\"term\":\"bulbul\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Persian\"], \"text\":\"From Persian \u0027بلبل\u0027 from Arabic \u0027بُلْبُل\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several passerine songbirds, of the family Pycnonotidae, native to Africa and parts of Asia, sometimes known as the ‘nightingale of the East’\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, \u0026quot;Reginald\u0027s Rubaiyat\u0026quot;, \u0027Reginald\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘Of course, if you want something really Persian and passionate, with red wine and \u0027\u0027bulbuls\u0027\u0027 in it,’ I went on to suggest; but she grabbed the book from me\", \"priority\":3}]}, \"synonyms\":{}}");

	add("bulgar", "{\"term\":\"bulgar\", \"etymology\":{\"influencers\":[], \"languages\":[\"Bulgarian\", \"English\", \"Latin\"], \"text\":\"From \u0027bulgarus\u0027 from Latin \u0027bulgarus\u0027 The ultimate origin is disputed:* From {{m|trk-pro|*bulɣar||of mixed origin}}, from {{m|trk-pro|*bulɣamak||to mix}}.\u0026lt;ref\u0026gt;per \u0027Room\u0027\u0026lt;/ref\u0026gt;* From the self-designation in Old Bulgarian \u0027блугарину\u0027 \u0026lt;ref\u0026gt;per the \u0027OED\u0027\u0026lt;/ref\u0026gt;* From a designation \u0027Volgar\u0027 in some language, meaning \u0026quot;Men of the Volga\u0026quot;, the river along which the tribe lived until the 6th century.\u0026lt;ref\u0026gt;{{R:Etymonline}}\u0026lt;/ref\u0026gt; \u0026lt;!--hence the rare, dated alt spelling \u0026quot;Volgarian\u0026quot;--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the migratory Turkic people from Central Asia which conquered Moesia in the 7th century and settled what is now Bulgaria, and some of whom then migrated to the Volga basin to establish w:Volga Volga Bulgaria\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Bulgarian\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1957\u0027\u0027, Walter Phelps Hall, ‎William Stearns Davis, \u0027The course of Europe since Waterloo\u0027, page 409\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Prince Alexander of Battenberg was chosen by the \u0027\u0027Bulgars\u0027\u0027 as their first ruler (1879\", \"priority\":4}]}, \"synonyms\":{}}");

