	add("bulkhead", "{\"term\":\"bulkhead\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bulk|head|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vertical partition dividing the hull into separate compartments; often made watertight to prevent excessive flooding if the ship\u0027s hull is breached\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A similar partition in an aircraft or spacecraft\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mechanically, a partition or panel through which connectors pass, or a connector designed to pass through a partition\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pressure-resistant sealed barrier to any fluid in a large structure\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A retaining wall along a waterfront\", \"priority\":5}]}, \"synonyms\":{}}");

	add("bully", "{\"term\":\"bully\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"middle high german (ca. 1050-1500)\", \"middle low german\", \"Dutch\"], \"text\":\"1530, from Dutch \u0027boel\u0027 (lover, brother) from Middle dutch (ca. 1050-1350) \u0027boel\u0027 from Proto-germanic {{m|gem-pro|*bō-lan-}} (compare Middle low german \u0027bōle\u0027 (brother) Middle high german (ca. 1050-1500) \u0027buole\u0027 (brother, close relative, close relation) German \u0027buhle\u0027 (lover) , diminutive of expressive {{m|gem-pro|*bō-||brother, father}}. More at boy.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is cruel to others, especially those who are weaker or have less power\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A playground \u0027\u0027bully\u0027\u0027 pushed a girl off the swing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I noticed you being a \u0027\u0027bully\u0027\u0027 towards people with disabilities\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A noisy, blustering fellow, more insolent than courageous; one who is threatening and quarrelsome; an insolent, tyrannical fellow\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Palmersto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bullies\u0027\u0027 seldom execute the threats they deal in\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A hired thug\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A prostitute’s minder; a pimp\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"bully Bully beef\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A brisk, dashing fellow\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"quot;Bully Bottom\u0026quot; from A Midsummer Night\u0027s Dream, III, i, 6\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The small scrum in the Eton College field game\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A small freshwater fish\", \"priority\":13}]}, \"synonyms\":{}}");

	add("bullcrap", "{\"term\":\"bullcrap\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bull|crap|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Bullshit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bulldog", "{\"term\":\"bulldog\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027bullbaiting|\u0027\u0027bull\u0027\u0027baiting\u0027 and \u0027dog\u0027. \u0026lt;!--The OED suggests this etymology and also it might come from the dog\u0027s apparent similarity to a bull--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A breed of dog developed in England by the crossing of the bullbaiting dog and the Pug to produce a ladies companion dog. Having a very smooth coat, a flattened face, wrinkly cheeks, powerful front legs and smaller hind legs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"British bulldo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A stubborn person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A refractory material used as a furnace lining, obtained by calcining the cinder or slag from the puddling furnace of a rolling mill\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of the proctors\u0027 officers\", \"priority\":5}]}, \"synonyms\":{}}");

