	add("bulldust", "{\"term\":\"bulldust\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027bull\u0027 + \u0027dust\u0027 In slang sense, a variant of \u0027bullshit\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Fine red dust, found in desert regions of Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, w:Slim Slim Dusty, Joy McKean, \u0027Another Day, Another Town\u0027, %22bulldusts%22+-intitle:%22bulldust%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGI4TT425BoPfmAWR2NT1Aw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22bulldusts%22%20-intitle%3A%22bulldust%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 151\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bulldust\u0027\u0027 is like talcum powder and it covers the holes in the road. No matter how carefully we drove, the \u0027\u0027bulldust\u0027\u0027 rose in the air and cascaded down over our vehicle to the extent that we sometimes used the wipers to clear the windscreen\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Dick Eussen, \u0027Australia\u0027s Savannah Way: Cairns to Broome\u0027, %22bulldusts%22+-intitle:%22bulldust%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGI4TT425BoPfmAWR2NT1Aw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22bulldusts%22%20-intitle%3A%22bulldust%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 23\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Road trains are over 50 m long when towing three trailers. On dirt roads, they trail a blinding cloud of \u0027\u0027bulldust\u0027\u0027 and window smashing, fist-size stones\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Leon Isackson, Jon Hayton, \u0027Behind the Rock and Beyond\u0027, %22bulldusts%22+-intitle:%22bulldust%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dHYsTT5udOIeEmQXjlI3sAw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22bulldusts%22%20-intitle%3A%22bulldust%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027bulldust\u0027\u0027 was starting to get really thick now and even thicker in the back of the Hudson! It got into everything\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Nonsense; blatantly false statements\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Antonio Casella, \u0027The Sensualist\u0027, %22bulldusts%22+-intitle:%22bulldust%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGpITT5-8OKTEmQXeqL3zAw\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22bulldusts%22%20-intitle%3A%22bulldust%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 10\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"She was told some \u0027\u0027bulldust\u0027\u0027. The same \u0027\u0027bulldust\u0027\u0027 they tell any dickhead willing to part with money: that she\u0027d be rich one day and live to a ripe old age\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, w:Arthur Arthur Ashe, Arnold Rampersad, \u0027Days of Grace: A Memoir\u0027, %22bulldusts%22+-intitle:%22bulldust%22+-inauthor:%22%22\u0026amp;dq\u003d%22bulldust%22|%22bulldusts%22+-intitle:%22bulldust%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4pQTT8-vD-X2mAWG2PzxAw\u0026amp;redir_esc\u003dy page 70\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"“Your theory is \u0027\u0027bulldust\u0027\u0027, Arthur,” said Pancho. “Nothing but \u0027\u0027bulldust\u0027\u0027. You should play your best doubles players even if they are playing singles. If they are fit, they are not going to be too tired. McEnroe would not have lost that match\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Catherine Deveny, \u0027Say When\u0027, %22bulldusts%22+-intitle:%22bulldust%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGpITT5-8OKTEmQXeqL3zAw\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22bulldusts%22%20-intitle%3A%22bulldust%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 181\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"In these harsh times of economic rationalism (sacking), restructuring (sacking) and merit-assessed and incentive-based liquidation and redirecting of human resources (sacking), the \u0027\u0027bulldust\u0027\u0027 detector is invaluable\", \"priority\":19}]}, \"synonyms\":{}}");

