	add("bullectomy", "{\"term\":\"bullectomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bulla|ectomy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A surgical procedure whereby small portions of the lung, called bulla, are removed. Bulla are large areas (\u0026gt; 1 cm in diameter) in the lung filled with oxygen-depleted air\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bullet", "{\"term\":\"bullet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027boulette\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A projectile, usually of metal, shot from a gun at high speed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ammunition for a sling or slingshot which has been manufactured for such use\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A printed symbol in the form of a solid circle, (•), often used for marking items in a list. (see also bulleted\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An entire round of unfired ammunition for a firearm, including the projectile, the cartridge casing, the propellant charge, etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A large scheduled repayment of the principal of a loan; a balloon payment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A rejection letter, as for employment, admission to a school or a competition\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"John\u0027s not going to any of his top schools; he got a \u0027\u0027bullet\u0027\u0027 from the last of them yesterday\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"One year of prison tim\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An ace (the playing card\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Anything that is projected extremely fast\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Very fast\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"bullet\u0027\u0027 train\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"bullet\u0027\u0027 chess\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A small ball. \u0026lt;!--Webster 1913--\u0026gt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, s:Robert Louis Robert Louis Stevenson, \u0027s:Virginibus Virginibus Puerisque\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Would you not suppose these persons had been whispered, by the Master of the Ceremonies, the promise of some momentous destiny? and that this lukewarm \u0027\u0027bullet\u0027\u0027 on which they play their farces was the bull\u0027s-eye and centrepoint of all the universe\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A cannonball\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A ship before Greenwich shot off her ordnance, one piece being charged with a \u0027\u0027bullet\u0027\u0027 of stone\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The fetlock of a horse\", \"priority\":19}]}, \"synonyms\":{}}");

	add("bulletin", "{\"term\":\"bulletin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027bulletin\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short report, especially one released through official channels to be broadcast or publicize\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A short news repor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A short printed publication, especially one produced by an organization\", \"priority\":3}]}, \"synonyms\":{}}");

