	add("bullion", "{\"term\":\"bullion\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"French\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027bulloin\u0027 \u0027bullioun\u0027 from Anglo-norman \u0027xno\u0027 of obscure origin, perhaps from French \u0027bouillon\u0027 extending the sense to that of \u0027melting\u0027. Middle dutch (ca. 1050-1350) \u0027lang\u003ddum|boelioen\u0027 () seems to have come from the unrelated French \u0027lang\u003dfr\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bulk quantity of precious metal, usually gold or silver, assessed by weight and typically cast as ingots\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"base or uncurrent coi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sylveste\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And those which eld\u0027s strict doom did disallow, / And damn for \u0027\u0027bullion\u0027\u0027, go for current now\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"showy metallic ornament, as of gold, silver, or copper, on bridles, saddles, etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Skelto\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The clasps and \u0027\u0027bullions\u0027\u0027 were worth a thousand pound\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A heavy twisted fringe, made of fine gold or silver wire and used for epaulets; also, any heavy twisted fringe whose cords are prominent\", \"priority\":8}]}, \"synonyms\":{}}");

	add("bullionism", "{\"term\":\"bullionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bullion|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An economic theory that defines wealth by the amount of precious metals owned; a primitive form of mercantilism\", \"priority\":1}]}, \"synonyms\":{}}");

