	add("bullock", "{\"term\":\"bullock\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027bulluc\u0027 corresponding to {{suffix|bull|ock|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A young bull\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And he brought the \u0027\u0027bullock\u0027\u0027 for the sin offering: and Aaron and his sons laid their hands upon the head of the \u0027\u0027bullock\u0027\u0027 for the sin offering\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A castrated bull; an ox\", \"priority\":3}]}, \"synonyms\":{}}");

	add("bullpen", "{\"term\":\"bullpen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An enclosed area used to hold bulls\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Magnus and Big Buck are over in the \u0027\u0027bullspen\u0027\u0027, ready for tonight\u0027s rodeo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An enclosed area for pitchers to warm up in during a game\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"After that hit, there is activity in the \u0027\u0027bullpen\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The relief pitchers of a team collectively\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Their \u0027\u0027bullpen\u0027\u0027 is worn out after yesterday\u0027s doubleheader where both games went 12 innings\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"metaphorical)\u0027 A figurative place for someone or something to get read\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"If this team of consultants fails, I have another warming up in the \u0027\u0027bullpen\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An open seating arrangement where project teams can communicate openly with minimal effort\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"We have our sales team in a \u0027\u0027bullpen\u0027\u0027 setup to keep their energy flowing\", \"priority\":10}]}, \"synonyms\":{}}");

	add("bullring", "{\"term\":\"bullring\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bull|ring|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The area in which a bullfight takes place\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bullroarer", "{\"term\":\"bullroarer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bull|roarer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ancient ritual musical instrument and means of communicating over extended distances, consisting of a slat of wood tied to the end of a thong or string, with which the slat is whirled so as to cause an intermittent roaring noise\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bullseye", "{\"term\":\"bullseye\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|bull|alt1\u003dbull\u0027s|eye|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The centre of a target\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The two central rings on a dartboard\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A peppermint-flavoured confection with stripes on it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Thick glass set into the side of a ship to let in light\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A shot which hits the centre of a target\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A hand-cancelled postmark issued by a counter clerk at a post office, typically done on a receipt for proof of mailing\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Thick glass window with concentric ripple effect\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A convex glass lens which is placed in front of a lamp to concentrate the light so as to make it more conspicuous as a signal; also the lantern itself\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, \u0027The Picture of Dorian Gray\u0027, ch. XII\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He put on his fur coat and hat and went out into the hall. There he paused, hearing the slow heavy tread of the policeman on the pavement outside and seeing the flash of the \u0027\u0027bull\u0027s-eye\u0027\u0027 reflected in the window\", \"priority\":10}]}, \"synonyms\":{}}");

	add("bullshit", "{\"term\":\"bullshit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|bull|shit|lang\u003den}}. In use since the 1920s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The faeces of a bull\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"False or exaggerated statements made to impress and deceive the listener rather than inform; nonsense\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t pay any attention to him. He talks a lot of \u0027\u0027bullshit\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A card game in which the object is to bluff about cards laid down and to determine when one\u0027s opponents are bluffing; also known as \u0026quot;BS\u0026quot;, \u0026quot;Cheat\u0026quot; or \u0026quot;I Doubt It\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Anyone want to play a few hands of \u0027\u0027bullshit\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An object of frustration and/or disgust, often caused by a perceived deception\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That\u0027s total \u0027\u0027bullshit\u0027\u0027! I called your office and they said you never came in\", \"priority\":7}]}, \"synonyms\":{}}");

