	add("bullycide", "{\"term\":\"bullycide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|bully|suicide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A suicide caused as the result of depression from bullying, especially children\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Gail Pursell Elliott, \u0027School mobbing and emotional abuse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Our research reveals that each year in the UK at least sixteen children commit \u0027\u0027bullycide\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Tamra B Orr, Sandra Giddens, Linda Bickerstaff, \u0027Suicide\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Jared\u0027s loss by \u0027\u0027bullycide\u0027\u0027 on September 29, 1998, filled our lives with grief\", \"priority\":5}]}, \"synonyms\":{}}");

	add("bulrush", "{\"term\":\"bulrush\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several wetland plants, mostly in the family Cyperaceae (the sedges\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sedges in the genera or (formerly considered \u0027Scirpus\u0027), having clusters of spikelets\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cattails or reedmace, in the genus \u0027Typha\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A plant referred to in the story of Moses as growing along the banks of the Nile, which is believed to be the papyrus\", \"priority\":4}]}, \"synonyms\":{}}");

	add("bulwark", "{\"term\":\"bulwark\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"middle low german\"], \"text\":\"From Middle english (1100-1500) from Middle dutch (ca. 1050-1350) \u0027bolwerk\u0027 \u0027bolwerc\u0027 and Middle low german \u0027bolwerk\u0027 equivalent to {{compound|bole|work|lang\u003den}}. Cognate with German \u0027bollwerk\u0027 Danish \u0027bolværk\u0027 Dutch \u0027bolwerk\u0027 See also English \u0027boulevard\u0027 (from French \u0027boulevard\u0027 from Dutch), Spanish \u0027baluarte\u0027 and Italian \u0027baluardo\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A defensive wall or rampart\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A defense or safeguard\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Blackston\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The royal navy of England hath ever been its greatest defence, the floating \u0027\u0027bulwark\u0027\u0027 of our island\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A breakwater\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The planking or plating along the sides of a nautical vessel above her gunwale that reduces the likelihood of seas washing over the gunwales and people being washed overboard\", \"priority\":6}]}, \"synonyms\":{}}");

